function shortenText(text) {
    // Check if the text is empty or undefined and return "-"
    if (!text) {
        return "-";
    }

    // If the text is longer than 180 characters, shorten it and add "..."
    if (text.length > 180) {
        return text.substring(0, 180) + "...";
    }

    // Otherwise, return the original text
    return text;
